Address: Sub Saharan Africa Climate Fund (SSACF), 5-16 Dering Street, Mayfair, London, W1S 5AR

They will demand  for  Psychometric testing - International Certified Psychometric and Situational Judgement Test (CPSJT) before you can be employed, after which they will refer you to other fake agencies who  will demand between $90 USD and $150 USD for online tests. and will usually ask you to pay through western Union etc.","created_at":"2018-03-20 22:52:27","updated_at":"2018-03-20 22:52:27","title":"Sub Saharan Africa Climate Fund --- SCAM!","author":"drwhyte","slug":"sub-saharan-africa-climate-fund-----scam-198446295Q75240","hashtags":"","pictures":""},"user":{"id":16,"name":"Wisdom Anthony","email":null,"created_at":"2018-03-21 07:13:56","updated_at":"2018-03-21 07:13:56","username":"Wisdom Anthony","pic":null,"provider":"facebook","provider_id":"967976170027001"}}

{"post":{"id":77,"user_id":"10","body":"Email: info.marigoldkitchen@gmail.com

Address: 73, Akerele Street Surulere Lagos

Marigold Mobile Kitchens claims to be a privately owned and operated corporation established in 2010 to provide mobile food service and logistics equipment in Nigeria. William Consult who recruits for them states the company's headquarters is in Nasarawa and that they serve by providing temporary food service solutions with their customers from all around the country. Marigold Mobile Kitchens doesn't exist on the CAC site, The real company is Marigold Kitchens based in Philadelphia, PA 19104, United States","created_at":"2018-03-21 19:34:28","updated_at":"2018-03-21 19:34:28","title":"Marigold Mobile Kitchens","author":"drwhyte","slug":"marigold-mobile-kitchens-544676U10822066","hashtags":"","pictures":""},"user":{"id":12,"name":"Tosin Lasisi","email":"thosynlasisi@gmail.com","created_at":"2018-03-16 06:20:48","updated_at":"2018-03-16 06:20:48","username":"Ridwan","pic":null,"provider":null,"provider_id":null}}

